// Function to display a number on a specific 7-segment display
void display_number_on_7seg(int display, int number) {
    // Lookup table for numbers 0-9 on a 7-segment display
    // Note: The bits are in the order 0-6, matching the segments as described above.
    static const int num_to_seg[10] = {
        0x3F, // 0
        0x06, // 1
        0x5B, // 2
        0x4F, // 3
        0x66, // 4
        0x6D, // 5
        0x7D, // 6
        0x07, // 7
        0x7F, // 8
        0x6F  // 9
    };

    // Check for valid display and number
    if (display < 0 || display > 5 || number < 0 || number > 9) {
        return; // Invalid input
    }

    // Determine the correct value to write
    int segment_value = num_to_seg[number];
    int value_to_write = segment_value;

    // Determine the address and shift based on the display
    volatile int* address;
    int shift;
    if (display <= 3) { // HEX0 to HEX3
        address = (volatile int*) HEX_BASE_0_TO_3;
        shift = (display * 8);
    } else { // HEX4 to HEX5
        address = (volatile int*) HEX_BASE_4_TO_5;
        shift = ((display - 4) * 8);
    }

    // Shift the segment value to the correct position and mask other displays
    value_to_write = (value_to_write << shift) | (*address & ~(0xFF << shift));

    // Write the value to the correct 7-segment display
    *address = value_to_write;
}


void wait_for_vsync() {
  volatile int *pixel_ctrl_ptr = (int *)0xff203020;  // base address
  int status;
  *pixel_ctrl_ptr = 1;  // start the synchronization process
  // write 1 into front buffer address register
  status = *(pixel_ctrl_ptr + 3);  // read the status register

  while ((status & 0x01) != 0)  // polling loop waiting for S bit to go to 0
  {
    status = *(pixel_ctrl_ptr + 3);
  }  // loop/function exits when status bit goes to 0
}

void plot_pixel(int x, int y, short int line_color) {
  volatile short int *one_pixel_address;

  one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);

  *one_pixel_address = line_color;
}



void drawBox(int x, int y, int width, int height, short int color) {
  for (int i = x; i < x + width; i++) {
    for (int j = y; j < y + height; j++) {
      plot_pixel(i, j, color);
    }
  }
}
void draw_line(int x0, int y0, int x1, int y1, int line_color) {
  int is_steep = abs(y1 - y0) - abs(x1 - x0);
  if (is_steep > 0) {
    int y_temp = y0;
    y0 = x0;
    x0 = y_temp;
    y_temp = y1;
    y1 = x1;
    x1 = y_temp;
  }
  if (x0 > x1) {
    int temp = x1;
    x1 = x0;
    x0 = temp;
    temp = y1;
    y1 = y0;
    y0 = temp;
  }
  int delta_x = x1 - x0;
  int delta_y = abs(y1 - y0);
  int error = -(delta_x / 2);
  int y = y0;
  int y_step;
  if (y0 < y1) {
    y_step = 1;
  } else {
    y_step = -1;
  }
  for (int x = x0; x <= x1; x++) {
    if (is_steep > 0) {
      plot_pixel(y, x, line_color);
    } else {
      plot_pixel(x, y, line_color);
    }
    error = error + delta_y;
    if (error > 0) {
      y = y + y_step;
      error = error - delta_x;
    }
  }
}

